def partitionRankings(rawRatings, testPercent):
    howManyNumbers = int(round(testPercent*len(rawRatings)))
    shuffled = rawRatings[:]
    random.shuffle(shuffled)
    return shuffled[howManyNumbers:], shuffled[:howManyNumbers]

def get_grid(upper_right, lower_left, n_rows, n_columns):
    all_boxes = []

    lon_steps = np.linspace(lower_left[1], upper_right[1], n_rows + 1)
    lat_steps = np.linspace(lower_left[0], upper_right[0], n_columns + 1)

    lat_stride = lat_steps[1] - lat_steps[0]
    lon_stride = lon_steps[1] - lon_steps[0]

    for lat in lat_steps[:-1]:
        for lon in lon_steps[:-1]:
            upper_left_x, upper_left_y = transform(inProj, outProj, lat + lat_stride, lon)
            upper_right_x, upper_right_y = transform(inProj, outProj, lat + lat_stride, lon + lon_stride)
            lower_right_x, lower_right_y = transform(inProj, outProj, lat, lon + lon_stride)
            lower_left_x, lower_left_y = transform(inProj, outProj, lat, lon)

            coordinates = [[upper_left_x, upper_left_y],
                           [upper_right_x, upper_right_y],
                           [lower_right_x, lower_right_y],
                           [lower_left_x, lower_left_y],
                           [upper_left_x, upper_left_y]]

            geo_json = {"type": "FeatureCollection",
                        "properties": {
                            "lower_left": [lower_left_x, lower_left_y],
                            "upper_right": [upper_right_x, upper_right_y]
                        },
                        "features": []}

            grid_feature = {
                "type": "Feature",
                "geometry": {
                    "type": "Polygon",
                    "coordinates": [coordinates],
                }
            }

            geo_json["features"].append(grid_feature)

            all_boxes.append(geo_json)
    return all_boxes
def get_fires_count(fire_date, fire_row, fire_column, dictionary):
    try:
        return len(dictionary[fire_date][fire_row, fire_column])
    except KeyError:
        return 0



