with open('dataset.pkl', 'rb') as df:
    final_dict = pickle.load(df)

coords_d = {}
with open(".\Данные станций\coordinates.txt", "r") as f:
    for line in f:
        (key, val_x, val_y) = line.replace('\n', '').split("\t")
        coords_d[key] = [float(val_x), float(val_y)]

station_links = {}
with open(".\Данные станций\ссылки на станции.txt", "r") as f:
    for line in f:
        (code, link, link_a) = line.replace('\n', '').split("\t")
        station_links[code] = [link, link_a]

meteo_info_array = []
for n in station_numbers:
    row = int(
        ((UPPER_RIGHT_CORNER[1] - coords_d[n][1]) // (
                (UPPER_RIGHT_CORNER[1] - LOWER_LEFT_CORNER[1]) / VERTICAL_CELLS)))
    column = int(
        (coords_d[n][0] - LOWER_LEFT_CORNER[0]) // (
                (UPPER_RIGHT_CORNER[0] - LOWER_LEFT_CORNER[0]) / HORIZONTAL_CELLS))
    meteo_info_array.append((n, row, column, station_links[n][0],station_links[n][1]))
final_dict['station_info'] = meteo_info_array
final_dict['region_grids'] = {}

def oper(f):
    if np.isnan(f):
        return float('nan')
    else:
        return f

c = sqlite3.connect('data.sqlite')
conn = c.cursor()
for k in final_dict.keys():
    if str(k) == 'map':
        try:
            conn.execute('CREATE TABLE ' + str(k) + ' (date,i,j,max_temp,humidity,days_without_rain,population_density,fires_count)')
        except:
            pass
        for d in final_dict['map'].keys():
            for i_j in final_dict['map'][d].keys():
                sql = 'INSERT INTO ' + str(k) + '(date,i,j,max_temp,humidity,days_without_rain,population_density,fires_count) VALUES (?,?,?,?,?,?,?,?)'
                conn.execute(sql, (str(d),str(i_j[0]),str(i_j[1]),str(oper(final_dict['map'][d][i_j]['max_temp'])),str(oper(final_dict['map'][d][i_j]['humidity'])),str(oper(final_dict['map'][d][i_j]['days_without_rain'])),str(oper(final_dict['map'][d][i_j]['population_density'])),str(final_dict['map'][d][i_j]['fires_count'])))
    elif str(k) == 'train_data':
        try:
            conn.execute('CREATE TABLE ' + str(k) + ' (id,x,y)')
        except:
            pass
        for ind in range(len(final_dict['train_data']['x_train'])):
            sql = 'INSERT INTO ' + str(k) + '(id,x,y) VALUES (?,?,?)'
            conn.execute(sql, (str(ind), str(final_dict['train_data']['x_train'][ind]).replace("[","").replace("]",""), str(final_dict['train_data']['y_train'][ind])))
        temp_ind = 0
        for inde in range(ind,ind+len(final_dict['train_data']['x_test']),1):
            sql = 'INSERT INTO ' + str(k) + '(id,x,y) VALUES (?,?,?)'
            conn.execute(sql, (str(inde), str(final_dict['train_data']['x_test'][temp_ind]).replace("[","").replace("]",""), str(final_dict['train_data']['y_test'][temp_ind])))
            temp_ind = temp_ind + 1
    elif str(k) == 'grid':
        try:
            conn.execute('CREATE TABLE ' + str(k) + ' (geojson,contour,VERICAL_CELLS,HORIZONTAL_CELLS,LOWER_LEFT_CORNER, UPPER_RIGHT_CORNER)')
        except:
            pass
        stri = json.dumps(final_dict['grid']['geojson'])
        strii = json.dumps(final_dict['contour'])
        conn.execute('INSERT INTO ' + str(k) + '(geojson,contour,VERICAL_CELLS,HORIZONTAL_CELLS,LOWER_LEFT_CORNER, UPPER_RIGHT_CORNER) VALUES (?,?,?,?,?,?)', (stri,strii,final_dict['grid']['VERTICAL_CELLS'],final_dict['grid']['HORIZONTAL_CELLS'],str(final_dict['grid']['LOWER_LEFT_CORNER'][0])+' '+str(final_dict['grid']['LOWER_LEFT_CORNER'][1]),str(final_dict['grid']['UPPER_RIGHT_CORNER'][0])+' '+str(final_dict['grid']['UPPER_RIGHT_CORNER'][1])))
    elif str(k) == 'start':
        try:
            conn.execute('CREATE TABLE additional_info (start_coords,region_name)')
        except:
            pass
        conn.execute('INSERT INTO additional_info(start_coords,region_name) VALUES (?,?)', (str(final_dict['start']).replace("[","").replace("]",""),str(final_dict['name'][0])))
    elif str(k) == 'station_info':
        try:
            conn.execute('CREATE TABLE station_info (code, row, column, link, link_archive)')
        except:
            pass
        sql_statement = 'INSERT INTO station_info (code, row, column,link, link_archive) VALUES (?,?,?,?,?)'
        conn.executemany(sql_statement, final_dict['station_info'])
    elif str(k) == 'region_grids':
        try:
            conn.execute('CREATE TABLE region_grids (row, column)')
        except:
            pass
        sql_statement = 'INSERT INTO region_grids (row, column) VALUES (?,?)'
        conn.executemany(sql_statement, i_n_js)

c.commit()
c.close()


